import Butt from '../buttons/register_btn';


function Navbar() {
    return(
        <>
            <nav className='flex h-[110px] items-center justify-evenly'>
                <div className='w-[639px] h-[66px] flex border-[1px] rounded-[30px]'>
                    <ul className='flex flex-row justify-around items-center w-full'>
                        <li>Home</li>
                        <li>Events</li>
                        <li>Student Essentials</li>
                        <li>Clubs</li>
                        <li>Clans</li>
                    </ul>
                </div>
                <Butt/>
            </nav>
        </>
    )
}

export default Navbar;
